import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { UserIcon } from '@heroicons/react/24/outline';

const Header = () => {
  const location = useLocation();
  
  return (
    <header className="fixed top-0 left-0 right-0 bg-white border-b border-border shadow-soft z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <Link to="/" className="flex items-center space-x-2">
            <div className="w-8 h-8 bg-accent rounded-lg flex items-center justify-center">
              <span className="text-white font-bold text-lg">B+</span>
            </div>
            <span className="text-xl font-poppins font-semibold text-primary">
              Benefit+
            </span>
          </Link>

          {/* Navigation */}
          <nav className="hidden md:flex items-center space-x-8">
            <Link 
              to="/" 
              className={`text-sm font-medium transition-colors duration-200 ${
                location.pathname === '/' 
                  ? 'text-accent' 
                  : 'text-text-secondary hover:text-text'
              }`}
            >
              Directory
            </Link>
            <Link 
              to="/profile" 
              className={`text-sm font-medium transition-colors duration-200 ${
                location.pathname === '/profile' 
                  ? 'text-accent' 
                  : 'text-text-secondary hover:text-text'
              }`}
            >
              Profile
            </Link>
          </nav>

          {/* User Profile Link */}
          <Link 
            to="/profile" 
            className="flex items-center space-x-2 text-text-secondary hover:text-text transition-colors duration-200"
          >
            <UserIcon className="w-6 h-6" />
            <span className="hidden sm:block text-sm font-medium">Profile</span>
          </Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
